function NavBar () {

    return (
    <div className="navbar-container" id='g'>
        <div className="navLeft">
            <p>ABIDI MOAD</p>
            <div className="navRightLeft">
                <a href='#pres'>Présentation</a>
                <a href='#real'>Réalisation</a>
